import React from 'react';
import { Col, Row } from 'antd';

const Footer = () => {
  return (
    <div style={{ padding: '83px 70px', backgroundColor: 'black' }}>
      <Row>
        <Col xl={12} lg={12} md={12} sm={24} xs={24}>
          <div
            style={{
              display: 'flex',
              width: '100%',
              justifyContent: 'flex-start',
              flexDirection: 'column',
            }}
          >
            <img
              src="./image/logo/logo2.png"
              style={{ width: '186px', height: '38px',marginBottom:'40px' }}
              alt="logo main"
            />
            <div style={{ display: 'flex', flexDirection: 'row' }}>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px' }}
              >
                Home
              </p>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px',marginRight:'3px',marginLeft:'3px' }}
              >
                |{' '}
              </p>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px' }}
              >
                Shop
              </p>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px',marginRight:'3px',marginLeft:'3px' }}
              >
                |{' '}
              </p>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px' }}
              >
                Kits
              </p>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px',marginRight:'3px',marginLeft:'3px' }}
              >
                |{' '}
              </p>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px' }}
              >
                About
              </p>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px',marginRight:'3px',marginLeft:'3px' }}
              >
                |{' '}
              </p>
              <p
                style={{ color: 'white', fontWeight: '400', fontSize: '14px' }}
              >
                Shipping policy
              </p>
            </div>
            <p
              style={{ fontWeight: '300', fontSize: '14px', color: '#FAFAFA' }}
            >
              #belikeAphrodite @since2020
            </p>
          </div>
        </Col>
        <Col xl={12} lg={12} md={12} sm={24} xs={24}>
          <div
            style={{
              display: 'flex',
              width: '100%',
              flexDirection:'column',
              justifyContent: 'flex-end',
              alignItems:'flex-end'
            }}
          >
              <div>

              </div>

          </div>
        </Col>
      </Row>
    </div>
  );
};
export default Footer
